import React from "react";

const button = props => {
    const styles = {
        textTransform: "uppercase"
    };

    return (
        <button className="btn btn-dark btn-lg btn-block" onClick={props.onClick} style={styles}>
            {props.name}
        </button>
    );
}

export default button;
